  const [users, setUsers] = useState([]);

  const addNewUserHandler = (newUser) => setUsers(prevState => [newUser, ...prevState]);

  return (
    <div>
      <AddUser onAddNewUser={ addNewUserHandler }/>
      {/*{ users.map(({ id, name, age }) => <Card key={ id } name={ name } age={ age }/>) }*/}
    </div>
  );
}

export default App;
